script: |
  super -f text -I q10050.spq | sort > q10050.out

inputs:
  - name: q10050.spq
    data: |
      SELECT ALL - 84, + col1 * + - 45 * col1 AS col2 FROM tab0 (FORMAT parquet) cor0 WHERE NOT NULL <> NULL AND ( + col0 BETWEEN + 91 - 47 * + col1 - - col0 AND NULL );
  - name: tab0

outputs:
  - name: q10050.out
    data: |
